const { jsPDF } = window.jspdf;

var regularfont = '';

var boldfont = '';


var callAddFont = function () {
this.addFileToVFS('Roboto-Regular-normal.ttf', regularfont);
this.addFont('Roboto-Regular-normal.ttf', 'Roboto', 'normal');

this.addFileToVFS('Roboto-Bold-bold.ttf', boldfont);
this.addFont('Roboto-Bold-bold.ttf', 'Roboto', 'bold');



};
jsPDF.API.events.push(['addFonts', callAddFont])
